import React from 'react';
import './DescSection.css';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'

const DescSection = () => {
  return (
    <Container>
      <Row>
       <div className= 'desc-section'>
         <p>Gooder™ &nbsp;is a new way of good-doing. Expand your community help while connecting & 
           socializing with people from all over the world. Whether you need something or have something to offer - 
           Gooder™ &nbsp;will open a new world of opportunities. Make your life better or change someone's life within a second - 
           It's all up to you.</p>
       </div>
      </Row>
    </Container>  
  );
};

export default DescSection;
